import React from 'react';
import './SupersetDashboard.css';

const SupersetDashboard = () => {
    return (
        <div className="superset-dashboard">
            <h1>Superset Dashboard</h1>
            <iframe
                src="http://your-superset-url/superset/dashboard/<dashboard_id>/"
                width="100%"
                height="800px"
                title="Superset Dashboard"
            ></iframe>
        </div>
    );
};

export default SupersetDashboard;
